import {PageHeader} from 'antd'


export default function AddRecruitment() {
    return (
        <div>
            <PageHeader className="site-page-header" onBack={() => null}
                        title="Title"
                        subTitle="This is a subtitle"
            />
            AddRecruitment
        </div>
    )
}
